function isPalindromePermutation(str){
  var letters = {}
  str.split('').forEach(function(char){
    if(!letters[char]) letters[char] = 0
    letters[char]++
  })
  var odd = 0
  for(char in letters){
    if(letters[char] % 2 !== 0){
      odd++
    }
  }
  return (odd === 1 ? 'YES' : 'NO')
}


console.log(isPalindromePermutation(''));
console.log(isPalindromePermutation('aaabbbb'));
